			"the whispers of those who stood their ground",
			"at Lioneye's Watch could be heard amongst the rubble.",
		},
	},
	[826] = {
		id = "UniqueBootsStrInt1",
		name = "Wake of Destruction",
		text = {
			"Tempest's power given form,",
			"Flee before the walking storm.",
		},
	},
	[827] = {
